INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 7, "2030/12/17 14:59:59", 0.0, 1, "キャル", -363.0, 1, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 106001, 0, 7001, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 7, "2030/12/17 14:59:59", 0.0, 1, "コッコロ", -363.0, 1, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 105901, 0, 7002, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 7, "2030/12/17 14:59:59", 0.0, 1, "ペコリーヌ", -363.0, 1, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 105801, 0, 7003, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 10, "2030/12/17 14:59:59", 0.0, 1, "ペコリーヌ", -363.0, 1, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 105801, 0, 10001, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 10, "2030/12/17 14:59:59", 0.0, 1, "キャル", -363.0, 1, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 106001, 0, 10002, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 10, "2030/12/17 14:59:59", 0.0, 1, "コッコロ", -363.0, 1, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 105901, 0, 10003, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 10, "2030/12/17 14:59:59", 0.0, 1, "シェフィ", -363.0, 1, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 106401, 0, 10004, 0.0, 2, 2104010);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 12, "2030/12/17 14:59:59", 0.0, 1, "ペコリーヌ", -416.5, 1, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 105801, 0, 12001, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 13, "2030/12/17 14:59:59", 0.0, 1, "キャル", -363.0, 1, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 106001, 0, 13001, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 13, "2030/12/17 14:59:59", 0.0, 1, "コッコロ", -363.0, 1, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 105901, 0, 13002, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 13, "2030/12/17 14:59:59", 0.0, 1, "シェフィ", -363.0, 1, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 106401, 0, 13003, 0.0, 2, 2104010);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 13, "2030/12/17 14:59:59", 0.0, 1, "ペコリーヌ", -363.0, 1, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 105801, 0, 13004, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 14, "2030/12/17 14:59:59", 0.0, 1, "コッコロ", -363.0, 1, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 105901, 0, 14001, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 14, "2030/12/17 14:59:59", 0.0, 1, "シェフィ", -363.0, 1, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 106401, 0, 14002, 0.0, 2, 2104010);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 14, "2030/12/17 14:59:59", 0.0, 1, "ペコリーヌ", -363.0, 1, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 105801, 0, 14003, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 14, "2030/12/17 14:59:59", 0.0, 1, "キャル", -363.0, 1, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 106001, 0, 14004, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 15, "2030/12/17 14:59:59", 0.0, 1, "コッコロ", -470.0, 1, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 105901, 0, 15001, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 16, "2030/12/17 14:59:59", 0.0, 1, "シェフィ", -363.0, 1, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 106401, 0, 16001, 0.0, 2, 2104010);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 16, "2030/12/17 14:59:59", 0.0, 1, "ペコリーヌ", -363.0, 1, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 105801, 0, 16002, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 16, "2030/12/17 14:59:59", 0.0, 1, "キャル", -363.0, 1, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 106001, 0, 16003, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 16, "2030/12/17 14:59:59", 0.0, 1, "コッコロ", -363.0, 1, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 105901, 0, 16004, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 17, "2030/12/17 14:59:59", 0.0, 1, "コッコロ", -363.0, 1, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 105901, 0, 17002, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 25, "2030/12/17 14:59:59", 0.0, 1, "キャル", -363.0, 1, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 106001, 0, 17004, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 25, "2030/12/17 14:59:59", 0.0, 1, "コッコロ", -363.0, 1, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 105901, 0, 17005, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 25, "2030/12/17 14:59:59", 0.0, 1, "シェフィ", -363.0, 1, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 106401, 0, 17006, 0.0, 2, 2104010);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 25, "2030/12/17 14:59:59", 0.0, 1, "ペコリーヌ", -363.0, 1, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 105801, 0, 17007, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 18, "2030/12/17 14:59:59", 0.0, 1, "カリン", -363.0, 1, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 190801, 0, 18001, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 18, "2030/12/17 14:59:59", 0.0, 2, "カリン", -363.0, 1, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 190801, 0, 18002, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 19, "2030/12/17 14:59:59", 0.0, 3, "カリン", -470.0, 1, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 190801, 0, 19001, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 19, "2030/12/17 14:59:59", 0.0, 4, "カリン", -470.0, 1, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 190801, 0, 19002, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 20, "2030/12/17 14:59:59", 0.0, 5, "カリン", -470.0, 1, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 190801, 0, 20001, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 20, "2030/12/17 14:59:59", 0.0, 6, "カリン", -470.0, 1, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 190801, 0, 20002, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 21, "2030/12/17 14:59:59", 0.0, 1, "キャル", -363.0, 1, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 106001, 0, 21001, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 21, "2030/12/17 14:59:59", 0.0, 1, "コッコロ", -363.0, 1, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 105901, 0, 21002, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 21, "2030/12/17 14:59:59", 0.0, 1, "シェフィ", -363.0, 1, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 106401, 0, 21003, 0.0, 2, 2104010);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 21, "2030/12/17 14:59:59", 0.0, 1, "ペコリーヌ", -363.0, 1, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 105801, 0, 21004, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 22, "2030/12/17 14:59:59", 0.0, 1, "カリン", -430.0, 1, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 190801, 0, 22001, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 22, "2030/12/17 14:59:59", 0.0, 2, "カリン", -430.0, 1, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 190801, 0, 22002, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 23, "2030/12/17 14:59:59", 0.0, 3, "カリン", -430.0, 1, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 190801, 0, 23001, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 23, "2030/12/17 14:59:59", 0.0, 4, "カリン", -430.0, 1, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 190801, 0, 23002, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2019/01/31 12:00:00", 24, "2030/12/17 14:59:59", 4.08, 1, "エリコ（バレンタイン）", -385.0, 2, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 109001, 10011, 24001, 8.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2019/01/31 12:00:00", 24, "2030/12/17 14:59:59", 5.0, 2, "エリコ（バレンタイン）", -385.0, 2, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 109001, 10011, 24002, 8.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2019/01/31 12:00:00", 24, "2030/12/17 14:59:59", 10.11, 3, "エリコ（バレンタイン）", -385.0, 2, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 109001, 10011, 24003, 8.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2019/01/31 12:00:00", 24, "2030/12/17 14:59:59", 4.0, 4, "エリコ（バレンタイン）", -385.0, 2, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 109001, 10011, 24004, 8.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2019/01/31 12:00:00", 24, "2030/12/17 14:59:59", 6.0, 5, "エリコ（バレンタイン）", -385.0, 2, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 109001, 10011, 24005, 8.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2019/01/31 12:00:00", 24, "2030/12/17 14:59:59", 0.0, 6, "エリコ（バレンタイン）", 0.0, 1, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 109002, 10011, 24006, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2019/01/31 12:00:00", 24, "2030/12/17 14:59:59", 0.0, 7, "エリコ（バレンタイン）", 0.0, 1, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 109002, 10011, 24007, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2019/01/31 12:00:00", 24, "2030/12/17 14:59:59", 0.0, 8, "エリコ（バレンタイン）", 0.0, 1, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 109002, 10011, 24008, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2019/01/31 12:00:00", 24, "2030/12/17 14:59:59", 0.0, 9, "エリコ（バレンタイン）", 0.0, 1, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 109002, 10011, 24009, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2019/01/31 12:00:00", 24, "2030/12/17 14:59:59", 0.0, 10, "エリコ（バレンタイン）", 0.0, 1, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 109002, 10011, 24010, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2019/01/31 12:00:00", 24, "2030/12/17 14:59:59", 2.12, 1, "シズル（バレンタイン）", -385.0, 2, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 109101, 10011, 24011, 8.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2019/01/31 12:00:00", 24, "2030/12/17 14:59:59", 4.19, 2, "シズル（バレンタイン）", -385.0, 2, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 109101, 10011, 24012, 8.0, 5, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2019/01/31 12:00:00", 24, "2030/12/17 14:59:59", 2.3, 3, "シズル（バレンタイン）", -385.0, 4, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 109101, 10011, 24013, 8.0, 2, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2019/01/31 12:00:00", 24, "2030/12/17 14:59:59", 0.0, 4, "シズル（バレンタイン）", 0.0, 1, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 109102, 10011, 24014, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2019/01/31 12:00:00", 24, "2030/12/17 14:59:59", 5.23, 5, "シズル（バレンタイン）", -385.0, 2, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 109101, 10011, 24015, 8.0, 5, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2019/01/31 12:00:00", 24, "2030/12/17 14:59:59", 0.0, 6, "シズル（バレンタイン）", 0.0, 1, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 109102, 10011, 24016, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2019/01/31 12:00:00", 24, "2030/12/17 14:59:59", 5.01, 7, "シズル（バレンタイン）", -385.0, 2, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 109101, 10011, 24017, 8.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2019/01/31 12:00:00", 24, "2030/12/17 14:59:59", 0.0, 8, "シズル（バレンタイン）", 0.0, 1, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 109102, 10011, 24018, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2019/01/31 12:00:00", 24, "2030/12/17 14:59:59", 0.0, 9, "シズル（バレンタイン）", 0.0, 1, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 109102, 10011, 24019, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2019/01/31 12:00:00", 24, "2030/12/17 14:59:59", 0.0, 10, "シズル（バレンタイン）", 0.0, 1, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 109102, 10011, 24020, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 26, "2030/12/17 14:59:59", 0.0, 1, "シェフィ", -363.0, 1, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", 106401, 0, 26001, 0.0, 2, 2104010);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 26, "2030/12/17 14:59:59", 0.0, 1, "ペコリーヌ", -363.0, 1, "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！", 105801, 0, 26002, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 26, "2030/12/17 14:59:59", 0.0, 1, "キャル", -363.0, 1, "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ", 106001, 0, 26003, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 26, "2030/12/17 14:59:59", 0.0, 1, "コッコロ", -363.0, 1, "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう", 105901, 0, 26004, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 27, "2030/12/17 14:59:59", 0.0, 1, "シェフィ", -363.0, 1, "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか", 106401, 0, 27001, 0.0, 2, 2104010);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 27, "2030/12/17 14:59:59", 0.0, 1, "ペコリーヌ", -363.0, 1, "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！", 105801, 0, 27002, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 27, "2030/12/17 14:59:59", 0.0, 1, "キャル", -363.0, 1, "ここにさらなる力を得るための\nアイテムが眠っているみたい！\nどんどん挑戦して\n強くなっちゃいましょ！", 106001, 0, 27003, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 27, "2030/12/17 14:59:59", 0.0, 1, "コッコロ", -363.0, 1, "こちらにさらなる力を得る\nためのアイテムが眠っている\nようです。主さま、どこから\n挑戦いたしましょう。", 105901, 0, 27004, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2019/09/24 15:00:00", 28, "2030/12/17 14:59:59", 0.0, 1, "カリン", -363.0, 1, "ようこそ！\n皆さんの素敵な出会いを\nギルド管理協会が\nお手伝いします！", 190801, 0, 28001, 0.0, 1, 0);
