INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2019/09/24 15:00:00", 30, "2030/12/17 14:59:59", 0.0, 5, "カリン", -409.0, 1, "フレンド管理は\nこちらになります\n新しいフレンドとの出会いを\n楽しんでくださいね！", 190801, 0, 30001, 0.0, 1, 0);
