INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2019/10/31 12:00:00", 31, "2030/12/17 14:59:59", 0.0, 8, "カリン", -409.0, 1, "気になるパーティと\nバトルをしてみましょう！\nどちらが勝利するのか、\n私も楽しみにしていますね", 190801, 0, 31002, 0.0, 1, 0);
