INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2019/12/20 5:00:00", 33, "2020/01/04 4:59:59", 0.0, 4, "カリン", -409.0, 1, "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！", 190801, 0, 33002, 0.0, 1, 0);
