INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 38, "2030/12/17 14:59:59", 5.3, 1, "ペコリーヌ", -458.0, 2, "過去のストーリーイベントを\n楽しめちゃいますよ！\n遊んだことのないものがあれば\n一緒にやってみましょう♪", 105801, 0, 38001, 0.0, 1, 0);
