INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2020/04/01", 39, "2020/04/08 23:59:59", 0.0, 0, "ペコリーヌ", 9999.0, 3, "", 105801, 0, 39005, 9999.0, 3, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 40, "2030/12/17 14:59:59", 0.0, 2, "カリン", -430.0, 1, "これまでに出題された\n問題を振り返ることが\nできますよ\n復習は大切です♪", 190801, 0, 40001, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 41, "2030/12/17 14:59:59", 0.0, 1, "シェフィ", -363.0, 1, "ここでは腕試しが\nできるんですって。\n自分の実力を測るのに、\nちょうどよさそうね。", 106401, 0, 41001, 0.0, 1, 2104010);
