INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 41, "2030/12/17 14:59:59", 0.0, 1, "キャル", -363.0, 1, "ここで腕試しが\nできるみたいね。\n試してみるのも\nいいんじゃない？", 106001, 0, 41003, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 41, "2030/12/17 14:59:59", 0.0, 1, "コッコロ", -363.0, 1, "腕試しができるようです。\nここで練習を重ね、実戦に\n活かしてまいりましょう。", 105901, 0, 41004, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 42, "2030/12/17 14:59:59", 0.0, 1, "コッコロ", -416.5, 1, "訓練の成果に応じて、\n報酬がもらえるそうです。\n共に励んでいきましょう。", 105901, 0, 42001, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 42, "2030/12/17 14:59:59", 0.0, 1, "シェフィ", -416.5, 1, "目標を達成すれば、\n報酬がもらえるみたい。\n頑張り甲斐があるわね。", 106401, 0, 42002, 0.0, 1, 2104010);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 42, "2030/12/17 14:59:59", 0.0, 1, "ペコリーヌ", -416.5, 1, "腕試しをがんばれば、\n報酬がもらえますよ。\n挑戦していきましょう☆", 105801, 0, 42003, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 42, "2030/12/17 14:59:59", 0.0, 1, "キャル", -416.5, 1, "ミッションを達成すると、\n報酬が出るんですって。\n一緒にやってみましょ！", 106001, 0, 42004, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 43, "2030/12/17 14:59:59", 0.0, 1, "ペコリーヌ", -363.0, 1, "ここからアリーナに\n挑戦できますよ！\n編成を工夫してライバルに\n挑んじゃいましょう！", 105801, 0, 43001, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 43, "2030/12/17 14:59:59", 0.0, 1, "コッコロ", -363.0, 1, "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。", 105901, 0, 43002, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 43, "2030/12/17 14:59:59", 0.0, 1, "キャル", -363.0, 1, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", 106001, 0, 43003, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 44, "2030/12/17 14:59:59", 0.0, 1, "アメス", -416.5, 1, "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪", 123001, 0, 43004, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 44, "2030/12/17 14:59:59", 0.0, 2, "アメス", -416.5, 1, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", 123001, 0, 43005, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 45, "2030/12/17 14:59:59", 5.79, 3, "アメス", -416.5, 2, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", 123001, 0, 43006, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 46, "2030/12/17 14:59:59", 0.0, 1, "アメス", -371.5, 1, "はい、お疲れさま。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。", 123001, 0, 46001, 0.0, 1, 0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("2015/12/17 15:00:00", 47, "2030/12/17 14:59:59", 0.0, 1, "シズル", -416.5, 2, "呼ばれて飛び出てお姉ちゃんだよ♪\nたとえ火の中、水の中、迷宮の中っ\nこのダンジョンを踏破できるよう\n弟くんを応援してあげるからねっ♪", 104901, 0, 47001, 0.0, 2, 0);
